public java.math.BigDecimal decimalRound(java.math.BigDecimal num, java.lang.Integer num_places){

        if(num_places<0)
        return num;

        String format = (num_places == 0)? "#" :"#.";
        for(java.lang.Integer i =1;i<=num_places;i++){
            format = format.concat("#");
        }
    java.text.DecimalFormat df = new java.text.DecimalFormat(format);
    df.setRoundingMode(java.math.RoundingMode.HALF_UP);
    java.math.BigDecimal out_num = new java.math.BigDecimal(df.format(num));
    return out_num;
}

public java.util.ArrayList<String> convertVectorToString(java.util.List inputList){
	java.util.ArrayList<String> strList = new java.util.ArrayList<String>();

if(inputList != null && inputList.size() != 0){
String combineVectorStr = "";

for(Object str : inputList){
combineVectorStr = combineVectorStr + str + "~";
}
strList.add(combineVectorStr);
return strList;
}
return strList;
}

public java.math.BigDecimal countListElements(java.util.List lst){
lst.removeAll(java.util.Arrays.asList("", null));
 return new java.math.BigDecimal(lst.size());
}

public java.math.BigDecimal date_day_of_week(java.lang.String date){
	 Calendar cal = Calendar.getInstance();
     cal.setTime(new Date(2000, 11, 21));
return new java.math.BigDecimal(cal.get(Calendar.DAY_OF_WEEK));
}

public String stringFilter(String str, String filter_str) {
String outputStr = "";
if (str != null && filter_str != null) {
char[] strToFilter = str.toCharArray();

for (char ch : strToFilter) {
if ((filter_str.indexOf(ch)) != -1) {
 outputStr = outputStr + String.valueOf(ch);
}
}
}
return outputStr;
}

public boolean isBlank(String str)
{
    return str != null && str.isEmpty();
}

public void removeListElements(java.util.List lst, java.util.List remove_elements) {

if(lst != null )
    lst.removeAll(remove_elements);
}

  public String stringSubstring(String str,java.lang.Integer start_index,java.lang.Integer length)
{
int startIndex = start_index < 0 ? 0 : start_index-1;
int substringLength = length < 0 ? 0 : length;

if( str == null || str.isEmpty() ) return str;
if(startIndex > str.length()) return "";
if(startIndex+substringLength > str.length()) return str.substring(startIndex);
else return str.substring(startIndex, startIndex + substringLength);

}

public String stringConcat(String... args) {
String str_concat = "";
for (String i : args) {
  if(i == null)
  {
      return null;
  }
str_concat = str_concat + i;
}

return str_concat;
}

